Файлаш сервера чу йоахаргйолаш пайда эца укх кепах.
ХьалхагIа хьачуяха хиннача файлашка [[Special:FileList|укхаза хьажа йиш я]]. Файлаш хьачуяхар дIаязду [[Special:Log/upload|хьачуяхарий тептара чу]]; дIаяхача файлех лаьца деша вIаштехьа да [[Special:Log/delete|дIадаьхарий тептара чу]].

Файл статьяна юкъейоаккхаргйолаш укх куце дола мугIараш хьаэца:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> файл ший бIарччача боарамца юкъейоаккхаргйолаш;
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|файлах лаьцар]]</nowiki></code></strong> 200 пикселах кIезигъяь йолаш йола файл текста аьрдехьа юкъейоаккхаргйолаш (файлах лаьца белгалдаь дола йоазув лохе хьа а гойташ);
